import React from 'react';

const Logs = () => {
  return (
    <ul class='collection with-header'>
      <li class='collection-header center'>
        <h4>Logs</h4>
      </li>
      <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li>
    </ul>
  );
};

export default Logs;
